  //ctx.clearRect(0, 0, this.width, this.height)\n      this.generateBackground()\n    } else {\n      setTimeout(() => {\n        this.onDraw()\n      }, 0)\n    }\n  }\n\n  generateBackground() {\n    const canvas = this.domCanvas?.nativeElement as HTMLCanvasElement\n    const ctx = canvas?.getContext('2d') as CanvasRenderingContext2D\n\n    let redValue = 0\n    let yellowValue = 0\n    let lightGreenValue = 0\n    let GreenValue = 0\n\n    let needleBorderColor = ''\n    let needleColor = ''\n    let endDotColor = ''\n    if (this.coverageRate > 300) {\n      GreenValue = 300\n      needleBorderColor = '#309557d2'\n      needleColor = '#45a96b'\n      endDotColor = '#1dd884'\n    } else if (this.coverageRate = 0) {\n      ctx.translate(this.width / 2 + this.margin, this.height / 2 + this.margin)\n      this.draw_aiguille(\n        ctx,\n        55,\n        needleColor,\n        needleBorderColor,\n        this.coverageRate\n      )\n    } else if (this.coverageRate  this.generateBackground())\n    /**\n    if (this.counter  this.generateBackground())\n    } else {\n      cancelAnimationFrame(myReq)\n    }\n     */\n  }\n\n  getRadiusPosition(degree: number) {\n    return degreesToRadians(180 + (degree * 9) / 10)\n  }\n\n  draw_aiguille(\n    ctx: CanvasRenderingContext2D,\n    lgd: number,\n    cl_int: string,\n    cl_bord: string,\n    angle: number\n  ) {\n    ctx.rotate(degreesToRadians(270 + (angle * 9) / 10)) //+ this.counter / 1000)\n    //this.counter++\n    ctx.beginPath()\n    ctx.fillStyle = cl_int\n    ctx.lineWidth = 2\n    ctx.strokeStyle = cl_bord\n\n    const cp1x = 8\n    const cp1y = 12\n    const cp2x = -8\n    const cp2y = 12\n\n    ctx.moveTo(7, 0)\n    ctx.bezierCurveTo(cp1x, cp1y, cp2x, cp2y, -7, 0)\n    ctx.lineTo(-3, -lgd)\n    ctx.bezierCurveTo(-2, -lgd - 3, 2, -lgd - 3, 3, -lgd)\n    ctx.lineTo(7, 0)\n    ctx.fill()\n    ctx.stroke()\n    ctx.closePath()\n    ctx.rotate(-angle)\n  }\n\n  drawPoint(\n    ctx: CanvasRenderingContext2D,\n